import React from 'react';
import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import './App.css';

const App = () => {
  return (
    <Router>
      <h3>start</h3>
        <Route path="/" exact element={<h2>hi from route</h2>}/>


    </Router>
  );
};


export default App;
